import React from 'react';
// import {useReducer} from 'react';
import Nav from "./pages/Nav"
import Signup from "./pages/Signup"
import './App.css';
import { Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div>
      <Nav/>
      <Routes>
        <Route path="/" element={Signup}/>
      </Routes>
    </div>
    </Router>
  );
}

export default App;
